import { StoreState } from ".";
import { Action, ActionTypes } from "../actions";

export const todosReducer = (state: StoreState, action: Action) => {
  switch (action.type) {
    case ActionTypes.fetchTodos:
      return action.payload
    case ActionTypes.deleteTodo:
      return
    default:
      return state
  }
}
